)
-------- Articulos -------------------------
-- Drop table Articulos
Create table Articulos(
	Codigo varchar(20) primary key,
	Nombre varchar(100) default 'Sin Nombre',
	Depa int not null,
	SubDepa int not null,
	Sku varchar(20) not null unique,
	Precio decimal(12,2) default 0,
	Costo decimal(12,2) check(Costo>=0), 
	TasaIva	int,
	TasaIeps int,
	Activo char(1) check(Activo='S' or Activo='N' or Activo='s' or activo='n'),
	--Activo char(1) check(Activo in('S','s','N','n')),
	Foreign key(Depa,Subdepa) references SubDepas(Depa,SubDepa)on delete no action on update no action
) 

Create table dbo.Proveedores(
	Id int not null primary key,
	Nombre varchar(100),
	Domicilio varchar(100),
	Ciudad varchar(50),
	Rfc varchar(13),
	Telefono varchar(50)
)

Create table dbo.TiposDeMovimientos(
	Tipo varchar(5) not null primary key,
	Descripcion varchar(50),
	Es char(1) check(Es in('E','S')),
	Venta char(1) check(Venta in('S','N'))
)

Create table dbo.Entradas(
	Tipo varchar(5) not null references TiposDeMovimientos(Tipo) on delete no action on update no action,
	Folio int not null,
	Fecha datetime,
	Fecha2 as convert(varchar(8),Fecha,112),
	Proveedor int not null references Proveedores(Id) on delete no action on update no action,
	SubTotal numeric(12, 2),
	Iva numeric(12, 2),
	Ieps numeric(12, 2),
	Total numeric(12, 2),
	Primary key (Tipo,Folio)
)

Create table dbo.EntradasDetalle(
	Tipo varchar(5) not null references TiposDeMovimientos(Tipo) on delete no action on update no action,
	Folio int not null,
	Renglon int not null,
	Fecha datetime,
	Fecha2 as convert(varchar(8),Fecha,112),
	Proveedor int not null references Proveedores(Id) on delete no action on update no action,
	Codigo varchar(20) not null references Articulos(Codigo) on delete no action on update no action,
	Cantidad numeric(12, 2),
	Costo numeric(12, 2),
	TasaIva numeric(12, 2),
	TasaIeps numeric(12, 2),
	Iva numeric(12, 2),
	Ieps numeric(12, 2),
	Total as (Cantidad*Costo),
	Primary key (Tipo,Folio,Renglon)
)

Create table dbo.Saldos(
	Codigo varchar(20) not null references Articulos(Codigo) on delete no action on update no action,
	Mes	char(6) not null,
	EntradasC numeric(12,2) default 0,
	EntradasV numeric(12,2) default 0,
	SalidasC numeric(12,2) default 0,
	SalidasV numeric(12,2) default 0,
	primary key(codigo,mes)
)
