--se insertara
CREATE trigger EntradasDetalle on dbo.EntradasDetalle 
after insert 
as
begin 
	--Aeclarar las variables a utilizar
	declare @codigo varchar(20),@mes varchar(6),@entradaC numeric(12,2),@entradaV numeric(12,2),@salidasC numeric(12,2),@salidasV numeric (12,2)

	set @codigo = (select top(1) ed.codigo from EntradasDetalle ed order by folio desc)

	if((select codigo from saldos) = @codigo)
	begin
	--aqui vamos a hacer un update
		set @mes = (select top(1) ed.fecha2 from EntradasDetalle ed order by folio desc)
		set @entradaC = (select sum(ed.cantidad) from EntradasDetalle ed where tipo = 'CO' group by tipo)
		set @entradaV = (select sum(ed.total) from EntradasDetalle ed where tipo = 'CO' group by tipo) 
		
		update saldos set entradasC = @entradaC where EntradasC = (select entradasC from saldos )
		update saldos set EntradasV = @entradaV where EntradasV = (Select entradasV from saldos)
		return
	end

	set @mes = (select top(1) ed.fecha2 from EntradasDetalle ed order by folio desc)
	set @entradaC = (select sum(ed.cantidad) from EntradasDetalle ed where codigo = @codigo )
	set @entradaV = (select sum(ed.total) from EntradasDetalle ed where codigo = @codigo)

	
	values(@codigo,@mes,@entradaC,@entradaV)
	
end


