create trigger dbo.nuevoEntradasDetalles on dbo.EntradasDetalle
after insert
as
begin
	declare @Codigo varchar(20),
	        @Mes char(6),
            @Cantidad Numeric(12,2),
			@Total numeric(12,2)

	declare miCursor cursor for select codigo, left(fecha2,6), cantidad, total from inserted
	Open miCursor
	fetch next from miCursor into @Codigo,@Mes,@Cantidad,@Total
	while (@@fetch_status = 0) 
	begin
		if not exists (select codigo from saldos where codigo = @Codigo and mes = @Mes)
		update dbo.Saldos set EntradasC = EntradasC + @Cantidad, EntradasV = EntradasV + @Total where Codigo = @Codigo and Mes = @Mes;
		fetch next from miCursor into @Codigo,@Mes,@Cantidad,@Total
	end
	Close miCursor
	Deallocate miCursor
end

