create trigger dbo.BorraEntradasDetalles on dbo.EntradasDetalle
after delete
as
begin
	declare @Codigo varchar(20),
	        @Mes char(6),
            @Cantidad Numeric(12,2),
			@Total numeric(12,2)

	declare miCursor cursor for select codigo, left(fecha2,6), cantidad, total from deleted
	Open miCursor
	fetch next from miCursor into @Codigo,@Mes,@Cantidad,@Total
	while (@@fetch_status = 0) 
	begin
		update dbo.Saldos set EntradasC = EntradasC - @Cantidad, EntradasV = EntradasV - @Total where Codigo = @Codigo and Mes = @Mes;
		delete from dbo.Saldos where  Codigo = @Codigo and Mes = @Mes and (EntradasC+EntradasV+SalidasC+SalidasV=0)
		fetch next from miCursor into @Codigo,@Mes,@Cantidad,@Total
	end
	Close miCursor
	Deallocate miCursor
end

