create trigger dbo.BorraEntradasDetalles2 on dbo.EntradasDetalle
after delete
as
begin
	update Saldos 
	set EntradasC=EntradasC-tabla.Sumacantidad,entradasV=EntradasV-tabla.SumaTotal 
	from Saldos s,(Select d.Codigo,s.mes,sum(Cantidad) as SumaCantidad, sum(total) as sumaTotal 
				from saldos s ,Deleted as d
				where s.Codigo=d.codigo and s.mes=left(d.Fecha2,6)
				group by d.Codigo,s.mes) tabla
	where s.Codigo=tabla.codigo and s.mes=tabla.mes
	Delete from Saldos where EntradasC+EntradasV+SalidasC+SalidasV=0
End

