-- Funcion para calcular el Costo Promedio Expres -----------------------
Create function dbo.fnCostoRapido(@Codigo varchar(20),@Mes char(6))
returns numeric(12,2)
as
Begin
	Declare @EntradasV numeric(5,2),
			@EntradasC numeric(5,2),
			@SalidasV numeric(5,2),
			@SalidasC numeric(5,2),
			@Costo numeric(12,2)

	Select @EntradasV=sum(EntradasV),@EntradasC=Sum(EntradasC),@SalidasV=Sum(SalidasV),@SalidasC=sum(SalidasC)
	from saldos where Codigo=@Codigo and Mes<=@Mes

	set @Costo=(@EntradasV-@SalidasV)/(@EntradasC-@SalidasC)

	return isnull (@Costo,0)
End

