Create procedure dbo.spRecosteo(@Codigo varchar(20),@Mes1 char(6),@Mes2 char(6))
as
Begin
	Create table #tabla(
		Es char(1),
		Tipo varchar(5) ,
		Folio int ,
		Renglon int ,
		Fecha datetime,
		Fecha2 varchar(8),
		Cliente int ,
		Codigo varchar(20),
		Cantidad numeric(12, 2),
		Costo numeric(12, 2),
		TasaIva numeric(12, 2),
		TasaIeps numeric(12, 2),
		Iva numeric(12, 2),
		Ieps numeric(12, 2),		
		SubTotalPrecio numeric(12, 2),
		IvaPrecio numeric(12, 2),
		IepsPrecio numeric(12, 2),
		Primary key (Fecha2,Es,Tipo,Folio,Renglon)
	)
	Declare @Costo numeric(12,2),
			@Es char(1),
			@Tipo varchar(5) ,
			@Folio int ,
			@Renglon int ,
			@Fecha datetime,
			@Fecha2 varchar(8),
			@Cliente int ,
			@Cantidad numeric(12, 2),
			@TasaIva numeric(12, 2),
			@TasaIeps numeric(12, 2),
			@Iva numeric(12, 2),
			@Ieps numeric(12, 2),		
			@SubTotalPrecio numeric(12, 2),
			@IvaPrecio numeric(12, 2),
			@IepsPrecio numeric(12, 2)

	begin transaction Recosteo


	delete from EntradasDetalle where codigo=@Codigo and left(fecha2,6)>=@Mes1 and left(fecha2,6)<=@Mes2
	delete from SalidasDetalle where codigo=@Codigo and left(fecha2,6)>=@Mes1 and left(fecha2,6)<=@Mes2
	delete from Saldos where codigo=@Codigo and mes>=@Mes1 and mes<=@Mes2

	declare CursorRecosteo cursor for select * from #tabla
	open CursorRecosteo
	Fetch next from CursorRecosteo into @Es,@tipo,@folio,@renglon,@fecha,@fecha2,@cliente,@codigo,@cantidad,@costo,@tasaiva,@tasaieps,@iva,@ieps,@subtotalPrecio,@IvaPrecio,@iepsPrecio
	while(@@Fetch_status=0)
	Begin
		if (@Es='E') Begin
		End Else Begin
			set @Costo=dbo.fnCostoRapido(@Codigo,left(@fecha2,6))
		End
		
		Fetch next from CursorRecosteo into @Es,@tipo,@folio,@renglon,@fecha,@fecha2,@cliente,@codigo,@cantidad,@costo,@tasaiva,@tasaieps,@iva,@ieps,@subtotalPrecio,@IvaPrecio,@iepsPrecio
	End
	Close CursorRecosteo
	Deallocate CursorRecosteo

	if(@@error=0) Begin
		commit transaction Recosteo
		print 'Todo Bien......'
	End else Begin
		rollback tran Recosteo
		print 'Valio ma......'
	End
End

