Create procedure dbo.spRecostear(@Codigo varchar(20),@Mes1 char(6),@Mes2 char(6))
as
Begin
	if(@codigo='*.*')
	Begin
		declare CursorRecostear cursor for Select distinct(codigo) from saldos
		Open CursorRecostear
		Fetch next from CursorRecostear into @Codigo
		while(@@Fetch_status=0)
		Begin
			Exec spRecosteo @Codigo,@Mes1,@Mes2
			Fetch next from CursorRecostear into @Codigo
		end
		Close CursorRecostear
		Deallocate CursorRecostear
	End Else
		Exec spRecosteo @Codigo,@Mes1,@Mes2
End

