Create trigger dbo.BitacoraArticulos on dbo.Articulos
after insert,update,delete
as 
Begin
	declare @operacion char(1),	
			@accion varchar(100),
			@usuario varchar(100)
	if(exists(select * from inserted))
	Begin
		if(exists(select * from deleted))
		Begin
			set @operacion='U'
			select @accion='Codigo: '+codigo from deleted
			select @accion=@accion+' X '+codigo from inserted
		end else begin
			set @operacion='I'
			select @accion='Codigo: '+codigo from inserted
		end
	End Else
	Begin
		set @operacion='D'
		select @accion='Codigo: '+codigo from deleted
	end
	set @usuario=dbo.Leeusuario()
end

