Create procedure dbo.spAuxiliar(@Codigo varchar(20),@Fecha1 char(8),@Fecha2 char(8))
as
Begin
	Create table #tabla(
		Es char(1),
		Tipo varchar(5) ,
		Folio int ,
		Renglon int ,
		Fecha datetime,
		Fecha2 varchar(8),
		CantidadE numeric(12, 2),
		CostoE numeric(12, 2),		
		CantidadS numeric(12, 2),
		CostoS numeric(12, 2),		
		CantidadT numeric(12, 2),
		CostoT numeric(12, 2),		
		Primary key (Fecha2,Es,Tipo,Folio,Renglon)
	)
	Declare @CantidadI numeric(12,2),
			@CostoI numeric(12,2),
			@Tipo varchar(5) ,
			@Folio int ,
			@Renglon int ,
			@CantidadE numeric(12, 2),
			@CostoE numeric(12, 2),		
			@CantidadS numeric(12, 2),
			@CostoS numeric(12, 2),
			@Can numeric(12, 2),
			@Cos numeric(12, 2)	

		Select @CantidadI=sum(EntradasC-SalidasC),@CostoI=sum(EntradasV-SalidasV) from saldos where codigo=@Codigo and mes<left(@Fecha1,6) 
		if(@CantidadI is null) begin
			set @CantidadI=0
			set @CostoI=0
		End
		
		select @Can=sum(cantidad),@Cos=sum(total) from EntradasDetalle where codigo=@Codigo and Fecha2>=left(@fecha1,6)+'01' and fecha2<@Fecha1
		if(@Can is not null) begin
			set @CantidadI=@CantidadI+@Can
			set @CostoI=@CostoI+@Cos
		end
		select @Can=sum(cantidad),@Cos=sum(total) from SalidasDetalle where codigo=@Codigo and Fecha2>=left(@fecha1,6)+'01' and fecha2<@Fecha1
		if(@Can is not null) begin
			set @CantidadI=@CantidadI-@Can
			set @CostoI=@CostoI-@Cos
		end

	
		declare CursorAuxiliar cursor for select Tipo,Folio,Renglon,CantidadE,CostoE,CantidadS,CostoS from #tabla
		open CursorAuxiliar
		Fetch next from CursorAuxiliar into @tipo,@folio,@renglon,@cantidadE,@costoE,@CantidadS,@CostoS
		Fetch next from CursorAuxiliar into @tipo,@folio,@renglon,@cantidadE,@costoE,@CantidadS,@CostoS
		while(@@Fetch_status=0)
		Begin
			set @CantidadI=@CantidadI+@CantidadE-@CantidadS
			set @CostoI=@CostoI+@CostoE-@CostoS
			update #Tabla set CantidadT=@CantidadI,CostoT=@CostoI where Tipo=@Tipo and Folio=@Folio and Renglon=@Renglon
			Fetch next from CursorAuxiliar into @tipo,@folio,@renglon,@cantidadE,@costoE,@CantidadS,@CostoS
		End
		Close CursorAuxiliar
		Deallocate CursorAuxiliar
		Select * from #Tabla
End

