alter procedure GuardaDepa(@Id int,@Nombre varchar(50),@Gerente varchar(200))
as
Begin
	Declare @Sig int
	if(@Id=-1)
		Select @Sig=Max(Id) from Depas
	if(@Sig is null)
		Set @Sig=1
	else
		Set @Sig=@Sig+1
	if(@Id=-1)
	else
		Update Depas set Nombre=@Nombre,Gerente=@Gerente where Id=@Id
End

